import React, { Component } from 'react';

import db from '../db';

class Table extends Component {

  constructor() {
    super();
    this.state = {
      teams: []
    };
  }

  fetchTeams() {

  }

  render (){
    return (
      <div className="Table">
        <h5>Tabla de Posiciones</h5>
        <table>
          <thead>
            <tr>
              <th>Equipo</th>
              <th>PJ</th>
              <th>G</th>
              <th>E</th>
              <th>P</th>
              <th>GF</th>
              <th>GC</th>
              <th>DG</th>
              <th>Pts</th>
            </tr>
          </thead>
          <tbody>
            {
              this.state.teams.map(team => {
                return (
                  <tr key={team._id}>
                    <td>{team.pj}</td>
                    <td>{team.g}</td>
                    <td>{team.e}</td>
                    <td>{team.p}</td>
                    <td>{team.gf}</td>
                    <td>{team.gc}</td>
                    <td>{team.dg}</td>
                    <td>{team.pts}</td>
                  </tr>
                )
              })
            }
          </tbody>
        </table>
      </div>
    );
  }
}

export default Table;
